/*===== 
	zax object */
var zex = {
	init : function( config ) {
		var self = this;
		self.config = config;

		self.initPlugins();
		self.initEvents();
	},
	initPlugins : function() {
		this.config.rotateFooterShap.bxSlider({
			minSlides: 1,
			maxSlides: 1,
			slideMargin: 0,
			ticker: true,
			autoDirection : 'prev',
			speed: 20000
		});
		this.config.gallerySlider.owlCarousel({
			autoPlay: 2000,
			stopOnHover : true,
	      	items : 3,
	      	itemsDesktop : [1000,4],
	      	itemsDesktopSmall : [900,3],
	      	itemsTablet: [600,2],
	      	itemsMobile : false,
	      	navigation : true
	  	});
		this.config.fancyBox.fancybox({
			padding: 0,
			openEffect : 'elastic',
			openSpeed  : 150,
			closeEffect : 'elastic',
			closeSpeed  : 150,
			closeClick : true,
			helpers : {
				overlay : null
			}
		});
	},
	initEvents : function() {
		this.config.tabs.on( 'click', this.runTabs );
	},
	runTabs : function( e ) {
		var self  = zex,
			$this = $(this);
			url   = $this.attr('href').substr(1),
			ul    = $this.closest('ul');

		if( url === 'lockPane' ) {
			ul.removeClass('nav-horizontal').addClass('nav-vertical');
		}else{
			ul.removeClass('nav-vertical').addClass('nav-horizontal');
		}
		$this.tab('show');
		e.preventDefault();
	}
};

$(function(){
	zex.init({
		rotateFooterShap : $('.rotate-footer-shap'),
		gallerySlider    : $('#gallerySlider'),
		tabs             : $('#tabs a'),
		fancyBox         : $('.fancybox')
	});
})

